import React from 'react';
import classNames from 'classnames';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import InputAdornment from '@material-ui/core/InputAdornment';
import TextField from '@material-ui/core/TextField';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import MenuItem from '@material-ui/core/MenuItem';
import Typography from '@material-ui/core/Typography';
import {connect} from 'react-redux'
import {bindActionCreators} from 'redux'
import moment from 'moment';


const styles = theme => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  margin: {
    margin: theme.spacing.unit,
  },
  withoutLabel: {
    marginTop: theme.spacing.unit * 3,
  },
  textField: {
    flexBasis: 200,
  },
  card: {
    maxWidth: 445,
  },
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  manDateTime: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: 200,
  },
  
});

const paymentModeDD = [
  {
    value: 'CASH',
    label: 'CASH ON DELIVERY',
  },
  // {
  //   value: 'CREDIT CARD',
  //   label: 'CREDIT CARD',
  // },
  // {
  //   value: 'DEBIT CARD',
  //   label: 'DEBIT CARD',
  // },
];

class BookingConfirmation extends React.Component {
  continue = e => {
    e.preventDefault();
    this.props.nextStep();
  }

  render() {
    const { classes,handleChange,values} = this.props;
    return (
        
      <div className = {classes.root + " boodDeliveryMainDiv "}>
      <Card className={classes.card + " card "}>
        <Typography component="h4" variant="h6" gutterBottom>
          Approximate Delivery Charge : 1000 INR. 
        </Typography>
        <br/>
        <Typography component="h4" variant="h4" gutterBottom>
          Pickup : {values.pickup}
        </Typography>
        <TextField
        select
        className={classNames(classes.margin, classes.textField) + " fields "}
        value={values.paymentMode}
        label = "Payment Mode"
        // InputProps={{
        //     startAdornment: <InputAdornment position="start">PAYMENT MODE</InputAdornment>,
        // }}
        onChange = {handleChange('paymentMode')}
        >
        {paymentModeDD.map(option => (
            <MenuItem key={option.value} value={option.value}>
            {option.label}
            </MenuItem>
        ))}
        </TextField>
        <CardActions>
            <Button size="small" color="primary" className="button-lg" 
              onClick = {this.continue}>
                CONFIRM BOOKING
            </Button>
        </CardActions>
      </Card>
      </div>
    );
  }
}

BookingConfirmation.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(BookingConfirmation)
